Less-than comparison for two `UniqueArc`s.

The two are compared by calling `<` on their inner values.

# Examples

```
#![feature(unique_rc_arc)]
use std::sync::UniqueArc;

let five = UniqueArc::new(5);

assert!(five < UniqueArc::new(6));
```
